eval("module.exports = JSON.parse(\"{\\\"title\\\":\\\"開發 Vue 的組件與重構 React 的組件\\\",\\\"section\\\":[{\\\"head\\\":\\\"成長\\\",\\\"content\\\":[\\\"今年我（ Noël ）的工作依舊不是很穩定，但我遇到蠻多奇特的人，也在他們身上學到蠻多，在我休息並找尋下一份工作的時候，我重構了整個網站，一個主站連接三個子站，重構完成之後，也製作了一些組件。我很高興能有時間開發自己的組件，下一年，希望我可以開發更多、更好的組件。\\\"]},{\\\"head\\\":\\\"成果\\\",\\\"content\\\":[\\\"今年我得工作變動很多，但我仍然盡量在我用 Vue 或者 React 開發的時候，多開發一些組件。\\\"],\\\"vue-content\\\":[\\\"考慮到我最近的工作是用 React 開發，基於 Vue 開發組件的計畫暫時會排在最低優先權。\\\"],\\\"products\\\":{\\\"js-languages\\\":\\\"更新版本，為了修短在 UMD 的名稱。\\\",\\\"js-validator\\\":\\\"正式發佈版本為 1.0.0，但我還有一些想法想要更新進去，所以明年，我應該會優先強化他。\\\",\\\"vue-list\\\":\\\"按照慣例，基於 Vue 的清單通常是我第一個開發的套件，畢竟我的範例網站第一個會需要應用的就是頁面的選單。\\\",\\\"vue-table\\\":\\\"表格則是第二個順位，但還沒完成，因為當我開發它的時候，我想到了一些關於套件設計的複雜度，到底應該為了便利性而包含一些功能，還是為了保持邏輯乾淨，讓它可以更輕易地跟其他套件一起使用？最後，我還是決定不增加排序、分頁、欄位過濾、搜尋，在這個表格的套件裏裡，但是它可以輕易地被擴展。\\\",\\\"react-list\\\":\\\"當我更新基於 React 的組件，我重構清單時，也試著簡化邏輯層面的程式碼。\\\",\\\"react-table\\\":\\\"原來的版本還沒有被發佈成正式版本，所以正式版本就直接是新版本的表格套件。\\\",\\\"react-popover\\\":\\\"在我前一個工作，我有最初版本的氣泡框，但是是基於 Vue 開發的，於是我又開發了一個基於 React 的版本，同時改善一些細節的邏輯。\\\",\\\"react-button\\\":\\\"這個組件包含兩個套件，我希望這兩個套件可以應用在所有關於按鈕的情境使用。\\\",\\\"react-message\\\":\\\"訊息是我最希望可以花時間開發的套件，我也還在想如何改善它到我期望的樣子。\\\",\\\"react-component-folder\\\":\\\"這是一個小型的套件，關於如何精簡單一子層的套件。\\\",\\\"react-facebook-sdk\\\":\\\"因為這個套件是基於臉書的 JavaScript SDK，嚴格來說不算是原創的套件。\\\"},\\\"js\\\":[{\\\"name\\\":\\\"@blacktoolbox/prototype-languages\\\",\\\"version\\\":\\\"1.1.1\\\",\\\"description\\\":\\\"更新版本，為了修短在 UMD 的名稱。\\\",\\\"url\\\":{\\\"github\\\":\\\"https://github.com/BlackToolBoxLaboratory/prototype-languages\\\",\\\"npm\\\":\\\"https://www.npmjs.com/package/@blacktoolbox/prototype-languages\\\",\\\"website\\\":\\\"https://blacktoolbox.cogman.org/javascript/#/packages/languages\\\"}},{\\\"name\\\":\\\"@blacktoolbox/prototype-validator\\\",\\\"version\\\":\\\"1.0.0\\\",\\\"description\\\":\\\"正式發佈版本為 1.0.0，但我還有一些想法想要更新進去，所以明年，我應該會優先強化他。\\\",\\\"url\\\":{\\\"github\\\":\\\"https://github.com/BlackToolBoxLaboratory/prototype-validator\\\",\\\"npm\\\":\\\"https://www.npmjs.com/package/@blacktoolbox/prototype-validator\\\",\\\"website\\\":\\\"https://blacktoolbox.cogman.org/javascript/#/packages/validator\\\"}}],\\\"vue\\\":[{\\\"name\\\":\\\"@blacktoolbox/prototype-languages\\\",\\\"version\\\":\\\"1.1.0\\\",\\\"description\\\":\\\"Here is a util for the web-sites which need to support multiple-languages. My original version are switch language with fetch file dynamic, but this version are all language file imported in the same time.\\\",\\\"url\\\":{\\\"github\\\":\\\"https://github.com/BlackToolBoxLaboratory/prototype-languages\\\",\\\"npm\\\":\\\"https://www.npmjs.com/package/@blacktoolbox/prototype-languages\\\",\\\"website\\\":\\\"https://blacktoolbox.cogman.org/javascript/#/packages/languages\\\"}},{\\\"name\\\":\\\"@blacktoolbox/prototype-validator\\\",\\\"version\\\":\\\"0.0.1\\\",\\\"description\\\":\\\"It's not the official version yet. Because I don't finish it and unused in any project completely. Most of algorithm are implemented, but required some useful and normal application rules to be added as default supported.\\\",\\\"url\\\":{\\\"github\\\":\\\"https://github.com/BlackToolBoxLaboratory/prototype-validator\\\",\\\"npm\\\":\\\"https://www.npmjs.com/package/@blacktoolbox/prototype-validator\\\",\\\"website\\\":\\\"https://blacktoolbox.cogman.org/javascript/#/packages/validator\\\"}}],\\\"react\\\":[{\\\"name\\\":\\\"@blacktoolbox/prototype-languages\\\",\\\"version\\\":\\\"1.1.0\\\",\\\"description\\\":\\\"Here is a util for the web-sites which need to support multiple-languages. My original version are switch language with fetch file dynamic, but this version are all language file imported in the same time.\\\",\\\"url\\\":{\\\"github\\\":\\\"https://github.com/BlackToolBoxLaboratory/prototype-languages\\\",\\\"npm\\\":\\\"https://www.npmjs.com/package/@blacktoolbox/prototype-languages\\\",\\\"website\\\":\\\"https://blacktoolbox.cogman.org/javascript/#/packages/languages\\\"}},{\\\"name\\\":\\\"@blacktoolbox/prototype-validator\\\",\\\"version\\\":\\\"0.0.1\\\",\\\"description\\\":\\\"It's not the official version yet. Because I don't finish it and unused in any project completely. Most of algorithm are implemented, but required some useful and normal application rules to be added as default supported.\\\",\\\"url\\\":{\\\"github\\\":\\\"https://github.com/BlackToolBoxLaboratory/prototype-validator\\\",\\\"npm\\\":\\\"https://www.npmjs.com/package/@blacktoolbox/prototype-validator\\\",\\\"website\\\":\\\"https://blacktoolbox.cogman.org/javascript/#/packages/validator\\\"}}]},{\\\"head\\\":\\\"下一步\\\",\\\"content\\\":[\\\"關於下一年的規劃，我在考慮是否翻新基於 Vue 的組件跟網站至 3.0，或者繼續 React 17 的翻新，希望我可以花更多時間專注在我的組件開發上，下一年我們可以做得更好，對吧？\\\"]}]}\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJzb3VyY2VzIjpbXSwibmFtZXMiOltdLCJtYXBwaW5ncyI6IiIsImZpbGUiOiIuL2xhbmd1YWdlcy96aC95ZWFyLTIwMjAuanNvbi5qcyIsInNvdXJjZVJvb3QiOiIifQ==\n//# sourceURL=webpack-internal:///./languages/zh/year-2020.json\n");

